import React from "react";
// import "./Header.css";
import {
  Stack,
  Button,
  AppBar,
  Toolbar,
  IconButton,
  Typography,
  Card,
  CardActions,
  Box,
  CardContent,
  CardHeader,
  Grid,
} from "@mui/material";
import TaskAltIcon from "@mui/icons-material/TaskAlt";

class Header extends React.Component {
  render() {
    return (
      <>
        <AppBar position="static">
          <Toolbar>
            <IconButton size="large" edge="start" color="inherit">
              <TaskAltIcon></TaskAltIcon>
            </IconButton>
            <Typography
              variant="h6"
              component="div"
              sx={{ flexGrow: 1, textAlign: "left" }}
            >
              Task Manager
            </Typography>
          </Toolbar>
        </AppBar>

        <Grid container sx={{ justifyContent: "center", my: 10 }}>
          <Grid item sx={{ maxWidth: 900, maxHeight: 700 }}>
            <Card
              raised="true"
              sx={{
                display: "flex",
                flexDirection: "column",
                width: 800,
                height: 200,
              }}
            >
              <CardHeader
                avatar={<TaskAltIcon></TaskAltIcon>}
                title="Create New Task"
                disableTypography="false"
                sx={{
                  textAlign: "left",
                  backgroundColor: "grey",
                }}
              ></CardHeader>
              <CardContent></CardContent>
              <CardActions>
                <Button size="small">Learn More</Button>
              </CardActions>
            </Card>
          </Grid>
        </Grid>
      </>
    );
  }
}

export default Header;
